import './App.css';
import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      result: ["nothing"]
    }
  }

  componentDidMount() {
    fetch("http://localhost:8080/coinexchange")
    .then(res => res.json())
    .then(
        (res) => {
          this.setState({
            exchanges: res[0],
            coins: res[1]
          });
        }
      );
  }

  render() {
    console.log(this.state);
    return (
      <div>
        { this.state.exchanges }
        { this.state.coins }
      </div>
    );
  }
}


export default App;
